2012ee27-7065-4eb0-81b1-2217dc6cc1c9.source:
this.parent = scene.children[1];

function update( event )
{
    this.rotation.z = Date.now() * -0.001;
	this.position.x = 1.3 * Math.sin(Date.now() * 0.001);
	this.position.y = 1.3 * Math.cos(Date.now() * 0.001);
}
